body:
Getting the output of `alacritty -vvv | grep "Writing escape sequence for dynamic color code"` would be very helpful I think.

I personally can't reproduce this with the latest master, so I can only take guesses here. Could you try this with an empty nvim config and give detailed instructions on how you're causing this?

I'd also be very interested in seeing if this can be reproduced with XTerm.

The following patch might also solve it already, please give that a try if you've got some time:

```diff
diff --git a/alacritty_terminal/src/term/mod.rs b/alacritty_terminal/src/term/mod.rs
index 5cfd503..4a07d5b 100644
--- a/alacritty_terminal/src/term/mod.rs
+++ b/alacritty_terminal/src/term/mod.rs
@@ -1883,7 +1883,7 @@ impl ansi::Handler for Term {
     fn dynamic_color_sequence<W: io::Write>(&mut self, writer: &mut W, code: u8, index: usize) {
         trace!("Writing escape sequence for dynamic color code {}: color[{}]", code, index);
         let color = self.colors[index];
-        let _ = write!(writer, "\x1b]{};rgb:{:x}/{:x}/{:x}\x07", code, color.r, color.g, color.b);
+        let _ = write!(writer, "\x1b]{};rgb:{1:x}{1:x}/{2:x}{2:x}/{3:x}{3:x}\x07", code, color.r, color.g, color.b);
     }
 
     /// Reset the indexed color to original value
```
